import './App.css';
import React from 'react';
import ReactDOM from 'react-dom/client';

function App() {
  return (
    <div className="App">
      <h1 className="App-header">Student Enrollment Form</h1>
      <label>Enter your Name:
        <input type="text" />
      </label> <></>
      <label>Enter your Email:
        <input type="text" />
      </label>
      <label>Website:
        <input type="text" />
      </label>
      <label>Image Link:
        <input type="text" />
      </label>
      <label>Gender:
        <input type="text" />
      </label>
    </div>
    );
}




export default App;
